Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      if(Key.isDown(_root.右键) == true)
      {
         _parent.移动("右",快速度);
      }
      else
      {
         _parent.移动("右",慢速度);
      }
   }
   else if(_parent.方向 == "左")
   {
      if(Key.isDown(_root.左键) == true)
      {
         _parent.移动("左",快速度);
      }
      else
      {
         _parent.移动("左",慢速度);
      }
   }
}

function 兵器冲击(子弹威力, Z轴攻击范围, 击倒率, 水平击退速度)
{
	var 子弹参数 = new Object();
	子弹参数.子弹威力 = 子弹威力;
	if (_parent.被动技能.刀剑攻击 && _parent.被动技能.刀剑攻击.启用)
	{
		子弹参数.子弹威力 *= 1 + _parent.被动技能.刀剑攻击.等级 * 0.1;
	}
	if (_parent.mp攻击加成)
	{
		子弹参数.子弹威力 += _parent.mp攻击加成;
	}
	子弹参数.Z轴攻击范围 = Z轴攻击范围;
	子弹参数.击倒率 = 击倒率;
	子弹参数.水平击退速度 = 水平击退速度;

	_parent.刀口位置生成子弹(子弹参数);
}

子弹威力 = _parent.空手攻击力 + _parent.刀属性.power;
Z轴攻击范围 = 30;
击倒率 = 10;
水平击退速度 = 10;
兵器冲击(子弹威力, Z轴攻击范围, 击倒率, 水平击退速度);

子弹威力 = _parent.空手攻击力 * 1.5 + _parent.刀属性.power;
Z轴攻击范围 = 30;
击倒率 = 10;
水平击退速度 = 10;
兵器冲击(子弹威力, Z轴攻击范围, 击倒率, 水平击退速度);

if(_parent.特效刀口){
	_parent.特效刀口.特效刀口触发("兵器冲击");
}

子弹威力 = _parent.空手攻击力 * 2.5 + _parent.刀属性.power;
Z轴攻击范围 = 30;
击倒率 = 1;
水平击退速度 = 12;
兵器冲击(子弹威力, Z轴攻击范围, 击倒率, 水平击退速度);

onClipEvent(enterFrame){
   _parent.攻击时移动(_parent._parent.跑X速度 * 1.2,_parent._parent.跑X速度 * 1.2);
}

onClipEvent (enterFrame) {
	if (_parent._parent._name == _root.控制目标)
	{
		//Key.isDown(_parent._parent.A键)更换为_parent._parent.动作A
		/*
		if (_parent._parent.被动技能.上挑 && _parent._parent.被动技能.上挑.启用 && _parent._parent.动作A && _parent._parent.动作B)
		{
			_parent._parent.状态改变("兵器跳");
		}
		*/
		if (!_parent._parent.飞行浮空 && _parent._parent.动作B)
		{
			_parent._parent.状态改变("兵器跳");
		}

	}
}

onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}
